import React from 'react';
import {Card ,Container, CardBody, CardText,CardFooter} from 'reactstrap';
import NavBar from './Nav';
import Showcase from './Showcase';
import HomeBody from './HomeBody';
const Home = () => {
    return (
        <div>
            <Container>
            <NavBar/>
        <Showcase/>
        <HomeBody/>
            </Container>

       
        </div>
    )
}

export default Home
